//Reactモジュール
import React, {useState,useRef, useEffect}from 'react';
//パッケージ
import { useCookies } from 'react-cookie';
import { NavLink, json, useNavigate } from 'react-router-dom';
//外部フレームワーク
import { motion,AnimatePresence } from 'framer-motion';
//CSS
import './Room.css';
//MUI
import { IconButton } from '@mui/material';
import Menu from '@mui/material';
import MenuItem from '@mui/material';
import MoreVertIcon from '@mui/icons-material/MoreVert';

const RoomListMenu = [
    'Delete',
]

const Room = () => {
    const messagesEndRef = useRef(null);
    const [room,setroom]=useState([]);
    const [unionRoom,setunionRoom]=useState([]);
    const [cookies,setCookie,removeCookie]=useCookies(['session_id']);
    const [anc,setanc]=useState(null);
    const navigate = useNavigate();
    const open = Boolean(anc);
    let roomNameID=[];



    const scrollToBottom = () => {
        if (messagesEndRef.current) {
            messagesEndRef.current.scrollIntoView({ behavior: "smooth", block: "end" });
        }
    };

    useEffect(()=>{
        setTimeout(()=>{
            getRoom();
        },2000);
    },[])

    const getRoom=()=>{
        fetch(`https://localhost:7038/api/ChatRoomCtl`,{
            credentials:'include',
            headers:{
                'Content-Type':'application/json',
            }
        })
        .then((response)=>{
            return response.json();
        })
        .then((data)=>{
            //console.log("successRoomData:",data);
            const roomName=data.result.map(e=>e.name);
            roomNameID=data.result.map(e=>e.room_id);
            setroom([...roomName]);
            setunionRoom([...roomName]);
        })
        .catch((error)=>{console.log("error:",error)})
        .finally(()=>scrollToBottom());
    }

    const handleRoomClick=(roomid)=>{
        const Romnum=unionRoom.indexOf(roomid);
        /*if((Romnum!==-1)){
            console.log("成功")
        }else{
            console.log("ありませんでした。");
        }*/
        
        //roomidは名前だけ取っているので、これがどこの番号か知りたい
        //console.log(roomid);
        navigate('/chat',{state:{name:Romnum}});
    }
    const changeAddRom=()=>{
        navigate('/AddGroup');
    }
    const Logout=()=>{
        removeCookie('sessionId');
        navigate('/');
    }
    const DeleteRoom=(e)=>{
        fetch(`https://localhost:7038/api/ChatRoomCtl?room=${e}`,{
            method:'DELETE',
            credentials:'include',
            headers:{
                'Content-Type':'application/json'
            }
        })
        .then((response)=>{
            console.log("削除",response);
            return json(response);
        })


    }
    const menuhandleClick=(e)=>{
        setanc(e.currentTarget);
    }
    const exeCu=(e)=>{
        if(e == 'Delete') DeleteRoom(e);
    }
    
    return (
        <div className='room'>
            <div className='Header'>
                <h1>ChatApp</h1>
                <button onClick={Logout} className='logout'>ログアウト</button>
                <h3>Room</h3>
            </div>
        
            <div className='container'>
                {room.map((data, index) => (
                    <button
                     key={index}
                     onClick={() => handleRoomClick(data)}
                     className='roomdata' 
                    >{data}
                        <IconButton
                            aria-label='more'
                            id='long-button'
                            aria-controls={open ? 'long-menu' : undefined}
                            aria-expanded={open ? 'true' : undefined}
                            aria-haspopup="true"
                            onClick={menuhandleClick()}
                        >
                            <MoreVertIcon/>   
                        </IconButton>
                        <Menu
                            id="long-menu"
                            MenuListProps={{
                                'aria-labelledby': 'long-button',
                            }}
                            anchorEl={anc}
                            open={open}
                            onClose={exeCu}
                            PaperProps={{
                            style: {
                                maxHeight: ITEM_HEIGHT * 4.5,
                                width: '20ch',
                            },
                            }}
                        >
                            {RoomListMenu.map((option)=>(
                                <MenuItem key={option} selected={option == 'Pyxis'} onClick={exeCu()}>
                                    {option}
                                </MenuItem>
                            ))}
                        </Menu>
                    </button>
                ))}     
            </div>
            <button onClick={changeAddRom} className='addrm'>部屋を追加</button> 
            <button >部屋の削除</button>
        </div>
    )
}

export default Room
